import { useState, useRef } from 'react';
import { DataTable, Table } from '@primer/react/experimental';
import { requestLog } from '../../../data/Data';
import { FilterIcon, XCircleFillIcon } from '@primer/octicons-react';
import {
  Box,
  Dialog,
  Link,
  Pagination,
  Heading,
  Text,
  TextInput,
  Button,
} from '@primer/react';

export function RequestLog() {
  const title = 'Request log';
  const description = 'View usage by individual request';

  const [isOpen, setIsOpen] = useState(false);
  const [selectedRow, setSelectedRow] = useState(null);
  const returnFocusRef = useRef(null);

  const openModal = (row) => {
    setSelectedRow(row);
    setIsOpen(true);
  };

  const closeModal = () => {
    setSelectedRow(null);
    setIsOpen(false);
  };

  const label = {
    width: '100px',
    fontWeight: 'semibold',
    fontSize: 1,
  };

  return (
    <Box sx={{ width: '100%', mt: 5 }}>
      <Box
        sx={{
          pb: 2,
          mb: 3,
          borderBottom: '1px solid',
          borderColor: 'border.default',
          width: '100%',
        }}
      >
        <Heading
          sx={{
            fontSize: 3,
          }}
        >
          {title}
        </Heading>
        <Text
          sx={{
            color: 'fg.muted',
            fontSize: 1,
          }}
        >
          {description}
        </Text>
      </Box>
      <Box
        sx={{
          display: 'flex',
          width: '100%',
        }}
      >
        <Button
          sx={{
            borderTopRightRadius: 0,
            borderBottomRightRadius: 0,
            borderRight: 0,
          }}
          leadingVisual={FilterIcon}
        >
          Filter
        </Button>
        <Box
          sx={{
            position: 'relative',
            mb: 3,
            width: '100%',
          }}
        >
          <TextInput
            sx={{
              width: '100%',
              borderTopLeftRadius: 0,
              borderBottomLeftRadius: 0,
              pl: 11,
            }}
            trailingAction={
              <TextInput.Action
                icon={XCircleFillIcon}
                aria-label='Clear input'
                sx={{ color: 'fg.subtle' }}
              />
            }
          />
          <Box
            sx={{
              position: 'absolute',
              left: 2,
              top: '50%',
              transform: 'translateY(-50%)',
              fontSize: 1,
              gap: 1,
              display: 'flex',
            }}
          >
            <Text>rate limited:</Text>
            <Text
              sx={{
                bg: 'accent.subtle',
                borderRadius: 1,
                px: 1,
                color: 'accent.emphasis',
              }}
            >
              true
            </Text>
          </Box>
        </Box>
      </Box>
      <Table.Container
        sx={{
          width: '100%',
        }}
      >
        <DataTable
          data={requestLog}
          columns={[
            {
              header: 'Request',
              field: 'request',
              rowHeader: true,
              renderCell: (row) => (
                <Box
                  sx={{
                    display: 'flex',
                    flexDirection: 'column',
                  }}
                >
                  <Link
                    data-testid='trigger-button'
                    ref={returnFocusRef}
                    onClick={() => openModal(row)}
                    sx={{
                      color: 'fg.default',
                      fontSize: 1,
                      cursor: 'pointer',
                    }}
                  >
                    <Text mr='2'>{row.type}</Text>
                    <Text fontWeight='normal'>{row.path}</Text>
                  </Link>
                  <Text
                    sx={{
                      color: 'fg.muted',
                      fontWeight: 400,
                    }}
                  >
                    {row.ip}
                  </Text>
                </Box>
              ),
            },
            {
              header: 'Status',
              field: 'status',
              width: '25%',
              renderCell: (row) => (
                <Text
                  sx={{
                    color: 'fg.default',
                    fontSize: 1,
                  }}
                >
                  {row.status}
                </Text>
              ),
            },
            {
              header: 'Date',
              field: 'date',
              width: '25%',
              renderCell: (row) => (
                <Text
                  sx={{
                    color: 'fg.default',
                    fontSize: 1,
                  }}
                >
                  {row.time}
                </Text>
              ),
            },
          ]}
        />
      </Table.Container>
      {selectedRow && (
        <Dialog
          returnFocusRef={returnFocusRef}
          isOpen={isOpen}
          onDismiss={closeModal}
          aria-labelledby='header'
          sx={{
            borderRadius: '12px',
            overflow: 'hidden',
          }}
        >
          <div data-testid='inner'>
            <Dialog.Header
              id='header'
              sx={{
                bg: 'canvas.default',
              }}
            >
              Request summary
            </Dialog.Header>
            <Box
              fontSize='1'
              p={3}
              sx={{
                display: 'flex',
                flexDirection: 'column',
                gap: 2,
              }}
            >
              <Box sx={{ display: 'flex' }}>
                <Text sx={label}>Path</Text>
                <Text sx={{ fontWeight: 'normal' }}>{selectedRow.path}</Text>
              </Box>
              <Box sx={{ display: 'flex' }}>
                <Text sx={label}>Status</Text>
                <Text sx={{ fontWeight: 'normal' }}>
                  <Box
                    sx={{
                      display: 'inline-block',
                      bg:
                        selectedRow.status === 200
                          ? 'success.emphasis'
                          : 'danger.emphasis',
                      borderRadius: '12px',
                      color: 'canvas.default',
                      width: '8px',
                      height: '8px',
                      mr: 2,
                    }}
                  />
                  {selectedRow.status} +
                </Text>
              </Box>
              {selectedRow.status !== 200 && (
                <Box sx={{ display: 'flex' }}>
                  <Text sx={label}>Error</Text>
                  <Text sx={{ fontWeight: 'normal' }}>{selectedRow.error}</Text>
                </Box>
              )}
              <Box sx={{ display: 'flex' }}>
                <Text sx={label}>Request</Text>
                <Text sx={{ fontWeight: 'normal' }}>
                  <Text as='span'>{selectedRow.request}</Text> / 15,000 per hour
                </Text>
              </Box>
              <Box sx={{ display: 'flex' }}>
                <Text sx={label}>Time</Text>
                <Text sx={{ fontWeight: 'normal' }}>{selectedRow.time}</Text>
              </Box>
              <Box sx={{ display: 'flex' }}>
                <Text sx={label}>IP address</Text>
                <Text sx={{ fontWeight: 'normal' }}>{selectedRow.ip}</Text>
              </Box>
              <Box sx={{ display: 'flex' }}>
                <Text sx={label}>Repository</Text>
                <Link sx={{ cursor: 'pointer' }}>
                  <Text sx={{ fontWeight: 'normal' }}>
                    {selectedRow.repository}
                  </Text>
                </Link>
              </Box>
            </Box>
          </div>
          <Box
            sx={{
              borderTop: '1px solid',
              borderColor: 'border.default',
              p: 3,
              display: 'flex',
              justifyContent: 'flex-end',
            }}
          >
            <Button onClick={closeModal}>Close</Button>
          </Box>
        </Dialog>
      )}
      {/* ... */}
    </Box>
  );
}
